* {
    box-sizing: border-box;
}

body {
    height: 100vh;
    margin: 0;
    overflow: hidden;
    background: #09021e;
}

canvas {
    display: block;
    position: absolute;
    z-index: -1;
}

main {
    position: fixed;
    width: 100%;
    height: 100vh;
    .homeContainer {
        display: flex;
        align-items: center;
        justify-content: center;
        flex-direction: column;
        height: 100vh;
        width: 100%;
        position: fixed;
        color: white;
        font-size: 5vh;
        .open {
            display: none;
        }
        .close {
            display: flex;
        }
    }
}

.btn {
    width: 150px;
    height: 50px;
    outline: none;
    // &__story {
    // }
    &__workShop {
        color: white;
        font-size: 2vh;
        width: 50px;
        height: 50px;
        background: red;
        display: none;
    }
    &__backHome {
        clip-path: inset(0% 100% 0% 0%);
        z-index: 2;
        position: absolute;
        &.open {
            pointer-events: all;
        }
        &.close {
            pointer-events: none;
        }
    }
}

////GRID WITH INTERACTIONS///
.colContainer {
    position: absolute;
    width: 100%;
    height: 100vh;
    z-index: -1;
    .col {
        clip-path: inset(100% 0% 0% 0%);
    }
}

.rowContainer {
    position: absolute;
    width: 100%;
    height: 100vh;
    z-index: -1;
    .row {
        clip-path: inset(0% 0% 0% 100%);
    }
}

.row {
    width: 100%;
    height: 2px;
    background: #0d0437; //4cc9f0
    margin-top: 20px;
    opacity: .65;
    &.line {
        width: 0;
        position: absolute;
        height: 2px;
        background: #1b355e;
        z-index: -1;
        opacity: 0.35;
        &__1 {
            bottom: 10.4%;
        }
        &__2 {
            bottom: 6.1%;
        }
    }
}

.col {
    width: 2px;
    height: 100vh;
    background: #0d0437;
    margin-right: 10px;
    margin-left: 10px;
    display: inline-block;
    opacity: .65;
    &.line {
        width: 2px;
        height: 0;
        background: #1b355e;
        position: absolute;
        z-index: -1;
        opacity: 0.35;
        &__1 {
            right: 2.6%;
        }
        &__2 {
            right: 0.3%;
        }
    }
}

////SOCIALS MEDIA///
.sm {
    width: 2.3%;
    height: 4.3%;
    position: absolute;
    right: .9%;
    color: white;
    font-weight: bold;
    display: flex;
    justify-content: center;
    align-items: center;
    z-index: 2;
    cursor: pointer;
    &__1 {
        bottom: 1.8%;
    }
    &__2 {
        bottom: 6.1%;
    }
    &__3 {
        bottom: 10.4%;
    }
}
